                    <option value="9">9%</option>
                    <option value="5">5%</option>
                </select></label>

                <label>Suma (be PVM)<input type="text" name="amount_wo_vat" id="amount_wo_vat" defaultValue={0} /></label>

                <label>PVM suma<input type="text" name="vat_amount" id="vat_amount" defaultValue={''} disabled="disabled" /></label>

                <label>Bendra suma (su PVM) <input type="text" id="total_amount" defaultValue={0} /></label>

            </form>

            <div>Įveskite sumą be PVM arba bendrą sumą (su PVM).</div>
        </main>
    return html;
}
export default Main;
